import React from 'react'
import { CaFoundation, MbaCourses, PgCourses, UgCourses } from './LandingPageData'
import {BgImg} from './Landing-imges/onlineEd.jpg'
import './LandingPage.css'

export const LandingPage = () => {
  return (
    <div className='BgImage' >
        <div style={{display: 'flex'}}>



            <div>
                {PgCourses.map(((itemm) => {
                    return(
                    <ul>
                        <li>{itemm}</li>
                    </ul>
                    )
                }))}
            </div>

            <div>
                {MbaCourses.map(((itemm) => {
                    return(
                    <ul>
                        <li>{itemm}</li>
                    </ul>
                    )
                }))}
            </div>

            <div>
                {CaFoundation.map(((itemm) => {
                    return(
                    <ul>
                        <li>{itemm}</li>
                    </ul>
                    )
                }))}
            </div>



        </div>
    </div>
  )
}
